import React from 'react';
import { Table } from "react-bootstrap";

function TriangleDimensions () {
    return (
        <Table bordered>
            <thead>
                <tr>
                    <h3>Triangle Dimensions</h3>
                </tr>
                <tr>
                    <th>
                        Side/Angle
                    </th>
                    <th>
                        Measurement
                    </th>
                </tr>
            </thead>
        </Table>


    );
};

export default TriangleDimensions;
